                if (!carry)
                    sum = "1" + sum;
                else {
                    sum = "0" + sum;
                    carry = true;
                }
            } else if (num1.charAt(size1) == '1' && num2.charAt(size2) == '1') {
                if (!carry)
                    sum = "0" + sum;
                else
                    sum = "1" + sum;
                carry = true;
            }
        }
        for (; size1 >= 0; size1--) {
            if (num1.charAt(size1) == '0') {
                if (!carry)
                    sum = "0" + sum;
                else
                    sum = "1" + sum;
                carry = false;
            } else if (num1.charAt(size1) == '1') {
                if (!carry)
                    sum = "1" + sum;
                else {
                    sum = "0" + sum;
                    carry = true;
                }
            }
        }
        if (carry)
            sum = "1" + sum;
        return sum;
    }
}

